def all_left_right_truncatable_prime(t):
    x = t[81]

    def is_prime(n):
        if n < 2:
            return False
        for i in range(2, int(n**0.5)+1):
            if n % i == 0:
                return False
        return True

    def is_left_right_truncatable_prim(n):
        if '0' in str(n):
            return False
        for i in range(len(str(n))):
            if not is_prime(int(str(n)[i:])):
                return False
            if not is_prime(int(str(n)[:len(str(n))-i])):
                return False
        return True

    prime_nums = [i for i in range(2, x+1) if is_prime(i)]
    trunct_primes = [i for i in prime_nums if is_left_right_truncatable_prim(i)]

    return sorted(trunct_primes, reverse=True)
